        if num < 2:
            return False
        for i in range(2, int(num**0.5)+1):
            if num % i == 0:
                return False
        return True

    def fib():
        a, b = 0, 1
        while True:
            yield a
            a, b = b, a + b

    count = 0
    for num in fib():
        if is_prime(num):
            count += 1
            if count == n:
